import { useEffect } from 'react';
import Sidebar from './sidebar';
import Articles from './articles';
import Fonts from '../fonts';

import '../asset/sass/app.scss';

const Index = () => {

  useEffect(() => {
    Fonts();
  });

  return(
    <div>
      <Sidebar />
      <Articles />
    </div>
  );
};

export default Index;
